  margin-top: 20px;
`;

export const Wrapper = styled.div`
  width: 50%;
  //hight: 100px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  background: #fff;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 10px 15px -3px,
